from Crypto.Util.number import *


def getd(n, e, dp):
    for i in range(1, e):
        if (dp * e - 1) % i == 0:
            if n % (((dp * e - 1) // i) + 1) == 0:
                p = ((dp * e - 1) // i) + 1
                q = n // (((dp * e - 1) // i) + 1)
                phi = (p - 1) * (q - 1)
                d = inverse(e, phi) % phi
                return d


